import React from "react";
import "../../../Styles/Pages/AllProducts/AllProductsFilter.scss";

function AllProductsFilter() {
  return (
    <div className='allProductsFilter'>
      <div className='filters'>
        <p>Filter:</p>
      </div>
    </div>
  );
}

export default AllProductsFilter;
